ISLAMABAD, Feb 9 (APP): Mutahidda Quomi Movement’s (MQM) Abdul Waseem has won the Sindh Assembly election from PS-123, Karachi Central-II, by securing 17,526 votes.
According to the unofficial result issued by the Returning Officer/ECP, his runner-up was Jamat e Islami’s candidate Muhammad Akbar, who bagged 13,117 votes.  Voters’ turn-out remained 33.46%.
